import { Header } from "./style";

export const LogoHeader = ({ filter }) => {
  return (
    <Header>
      <div>
        <h1>
          Burguer <span>Kenzie</span>
        </h1>

        <form>
          <input
            type="text"
            placeholder="Digitar pesquisa"
            onSubmit={(event) => filter(event.preventDefault())}
          />
          <button type="submit">Pesquisar</button>
        </form>
      </div>
    </Header>
  );
};
